import { useState } from 'react';
import { motion } from 'framer-motion';

function Contact() {
  const [formData, setFormData] = useState({ name: '', email: '', message: '' });
  const [status, setStatus] = useState('');

  const handleSubmit = async (e) => {
    e.preventDefault();
    try {
      const response = await fetch('http://localhost/portfolio/server/api/contact.php', {
        method: 'POST',
        headers: { 'Content-Type': 'application/json' },
        body: JSON.stringify(formData)
      });
      const result = await response.json();
      if (result.success) {
        setStatus('Message sent successfully!');
        setFormData({ name: '', email: '', message: '' });
      } else {
        setStatus('Error sending message.');
      }
    } catch (error) {
      setStatus('Error sending message.');
    }
  };

  const handleChange = (e) => {
    setFormData({ ...formData, [e.target.id]: e.target.value });
  };

  const inputVariants = {
    focus: { borderColor: '#3498db', scale: 1.02 }
  };

  return (
    <motion.section
      id="contact"
      className="section contact"
      initial={{ opacity: 0, y: 30 }}
      whileInView={{ opacity: 1, y: 0 }}
      transition={{ duration: 0.8, delay: 0.5 }}
      viewport={{ once: true }}
    >
      <motion.h2
        initial={{ opacity: 0, x: -20 }}
        animate={{ opacity: 1, x: 0 }}
        transition={{ duration: 0.6 }}
      >
        Contact Me
      </motion.h2>
      <form id="contact-form" onSubmit={handleSubmit}>
        <div className="form-group">
          <motion.label
            htmlFor="name"
            animate={formData.name ? { y: -25, fontSize: '0.8rem' } : {}}
            transition={{ type: 'spring', stiffness: 300 }}
          >
            Your Name
          </motion.label>
          <motion.input
            type="text"
            id="name"
            placeholder="Your Name"
            value={formData.name}
            onChange={handleChange}
            required
            whileFocus="focus"
            variants={inputVariants}
          />
        </div>
        <div className="form-group">
          <motion.label
            htmlFor="email"
            animate={formData.email ? { y: -25, fontSize: '0.8rem' } : {}}
            transition={{ type: 'spring', stiffness: 300 }}
          >
            Your Email
          </motion.label>
          <motion.input
            type="email"
            id="email"
            placeholder="Your Email"
            value={formData.email}
            onChange={handleChange}
            required
            whileFocus="focus"
            variants={inputVariants}
          />
        </div>
        <div className="form-group">
          <motion.label
            htmlFor="message"
            animate={formData.message ? { y: -25, fontSize: '0.8rem' } : {}}
            transition={{ type: 'spring', stiffness: 300 }}
          >
            Your Message
          </motion.label>
          <motion.textarea
            id="message"
            placeholder="Your Message"
            rows="5"
            value={formData.message}
            onChange={handleChange}
            required
            whileFocus="focus"
            variants={inputVariants}
          ></motion.textarea>
        </div>
        <motion.button
          type="submit"
          whileHover={{ scale: 1.05 }}
          whileTap={{ scale: 0.95 }}
          transition={{ type: 'spring', stiffness: 300 }}
        >
          Send Message
        </motion.button>
      </form>
      {status && <p className="status-message">{status}</p>}
      <motion.div
        className="social-links"
        initial={{ opacity: 0 }}
        animate={{ opacity: 1 }}
        transition={{ duration: 0.6, delay: 0.7 }}
      >
        {[
          { icon: 'fab fa-linkedin', link: '#' },
          { icon: 'fab fa-github', link: '#' },
          { icon: 'fas fa-envelope', link: '#' }
        ].map((social, index) => (
          <motion.a
            key={social.icon}
            href={social.link}
            aria-label={social.icon.split(' ')[1]}
            whileHover={{ scale: 1.2, rotate: 10 }}
            transition={{ type: 'spring', stiffness: 300 }}
          >
            <i className={social.icon}></i>
          </motion.a>
        ))}
      </motion.div>
    </motion.section>
  );
}

export default Contact;
